import logo from './logo.svg';
import './App.css';

const Person_Method = (name, lastName = 'Veio', age) => {
  return (
    <div className="Person">
      {
        name ? (
          <>
            <h1>Name: {name}</h1>
            <h2>Last Name: {lastName}</h2>
            <h3>Age: {age}</h3>
          </>
        ) : (
          <>
            <h1>Name: ...</h1>
            <h2>Last Name: ...</h2>
            <h3>Age: ...</h3>
          </>
        )
      }
    </div>

  )
}

const Person_Component = (props) => {
  return (
    <div className="Person">
      {
        props.name ? (
          <>
            <h1>Name: {props.name}</h1>
            <h2>Last Name: {props.lastName}</h2>
            <h3>Age: 36</h3>
          </>
        ) : (
          <>
            <h1>Name: ...</h1>
            <h2>Last Name: ...</h2>
            <h3>Age: ...</h3>
          </>
        )
      }
    </div>

  )
}

const App = () => {
  const name = null;
  const isNameShowing = false;
  return (
    <div className="App">
      <h1>Hello, React!</h1>
      {Person_Method("arthur", "morgan")}
      <Person_Component name="Arthur"></Person_Component>
    </div>
  );
}

export default App;
